import React from 'react';

const ImageDisplay = ({ imageUrl }) => {
  if (!imageUrl) return null; // If no imageUrl, don't render anything

  return (
    <div>
      <img src={imageUrl} alt="Fetched actress" />
    </div>
  );
};

export default ImageDisplay;
